/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import { Link } from 'react-router-dom';
import '../css/home.css';

export default class Home extends React.Component {
    constructor(props) {
        super(props);
        this.props = {

        }
    }

    componentDidMount() {
    }

    render() {
        return (
            <div style={{ width: "100%", height: "100%" }}>
                <div id="enter-screen" style={{ width: "100%", height: "100%" }}>
                    <div className="container">
                        <figure className="logo animated fadeInDown delay-07s">
                            <Link to="#"><img src={require("../images/logo.png")} alt="" /></Link>
                        </figure>
                        <h1 className="logo-detail animated fadeInUp delay-1s">
                            Школа изучения английского языка<br /> для детей 5-18 лет
                    </h1>
                        <a className="link animated fadeInUp delay-1s servicelink" href="#about">Начать</a>
                    </div>
                </div>
                <nav class="main-nav-outer" id="head">
                    {/* <!--main-nav-start--> */}
                    <div class="container">
                        <ul class="main-nav">
                            <li><a href="#header">О школе</a></li>
                            <li><a href="#service">Методика</a></li>
                            <li><a href="#Portfolio">Контакты</a></li>
                            <li class="small-logo"><a href="#enter-screen"><img src={require("../images/logo.png")} alt="" /></a></li>
                            <li><a href="#client">Вопросы</a></li>
                            <li><a href="#team">Пробный урок</a></li>
                            <li><a href="#contact">Ввойти</a></li>
                        </ul>
                    </div>
                </nav>
                <div id="about" className="emp-space"></div>
            </div>)
    }
}
